"a6\" endpoint=\"get_offset_neural\">\n              <parameters>\n                <label>Get item offset</label>\n                <arguments/>\n                <stream>\n                  <sensors/>\n                  <aggregators/>\n                  <costs/>\n                </stream>\n              </parameters>\n              <code>\n                <prepare/>\n                <finalize output=\"result\">data.adjusted = {\n  'x' =&gt; data.item['x'] + result['dir_x'],\n  'y' =&gt; data.item['y'] + result['dir_y']\n}</finalize>\n                <update output=\"result\"/>\n                <rescue output=\"result\"/>\n              </code>\n              <annotations>\n                <_timing>\n                  <_timing_wait/>\n                  <_timing_threshold/>\n                  <_timing_min/>\n                  <_timing_max/>\n                  <_timing_avg/>\n                </_timing>\n                <_notes>\n                  <_notes_general/>\n                </_notes>\n              </annotations>\n              <documentation/>\n            </call>\n            <call id=\"a8\" endpoint=\"grip_and_place\">\n              <parameters>\n                <label>Grip and Place</label>\n                <arguments>\n                  <x>!data.adjusted['x'].round(0)</x>\n                  <y>!data.adjusted['y'].round(0)</y>\n                  <place_x>!data.place[0]</place_x>\n                  <place_y>!data.place[1]</place_y>\n                </arguments>\n                <stream>\n                  <sensors/>\n                  <aggregators/>\n                  <costs/>\n                </stream>\n              </parameters>\n              <annotations>\n                <_timing>\n                  <_timing_wait/>\n                  <_timing_threshold/>\n                  <_timing_min/>\n                  <_timing_max/>\n                  <_timing_avg/>\n                </_timing>\n                <_notes>\n                  <_notes_general/>\n        